        <h1 class="text-h4 font-weight-bold text-secondary-text-color mb-4">FastDoc Informed consent</h1>
        <p class="text-body-1 text-primary-text-color mb-4">Telehealth involves the use of electronic communications to enable healthcare providers at different locations to share individual patient medical information for the purpose of improving patient care. Telehealth services also include remote monitoring, tele-pharmacy, prescription refills, appointment scheduling, regional health information sharing, and non-clinical services, such as education programs, administration, and public health. Medical providers may include primary care practitioners, specialists, and/or subspecialists. The information may be used for diagnosis, therapy, follow-up and/or education, and may include any combination of the following: (1) patient medical records; (2) medical images; (3) live two-way audio and video; (4) interactive audio; and (5) output data from medical devices and sound and video files.</p>
        <p class="text-body-1 text-primary-text-color mb-4">Electronic systems used will incorporate network and software security protocols to protect the confidentiality of patient identification and imaging data and will include measures to safeguard the data and to ensure its integrity against intentional or unintentional corruption.</p>
        <p class="text-body-1 text-primary-text-color mb-4">Primary responsibility for your medical care should remain with your local primary care doctor, if you have one, as does your medical record.</p>
        
        <h2 class="text-body-1 font-weight-bold text-primary-text-color mt-8 mb-2">Expected Benefits:</h2>
        <p class="text-body-1 text-primary-text-color mb-4">Improved access to medical care by enabling you to remain in your local healthcare site (i.e. home) while the provider consults and obtains test results at distant/other sites.</p>
        <p class="text-body-1 text-primary-text-color mb-4">More efficient medical evaluation and management.</p>
        <p class="text-body-1 text-primary-text-color mb-4">Obtaining expertise of a specialist.</p>

