        <p class="text-body-1 text-primary-text-color mb-4">In very rare events, security protocols could fail, causing a breach of privacy of personal medical information.</p>
        <p class="text-body-1 text-primary-text-color mb-4">In rare events, a lack of access to complete medical records may result in adverse drug interactions or allergic reactions or other judgment errors.</p>
