        <h1 class="text-h4 font-weight-bold text-secondary-text-color mt-8 mb-4">WASHINGTON CONSUMER HEALTH DATA PRIVACY NOTICE</h1>
        <p class="text-body-1 text-primary-text-color mb-4">This Washington Consumer Health Data Privacy Notice applies to “consumer health data” collected from Washington state residents and those whose consumer health data is collected through the FastDoc, LLC. (“FastDoc,” “we,” “us,” or “our”) or affiliated website on which it is posted, as well as those whose consumer health data is collected in the State of Washington. This notice applies to Washington residents and those whose consumer health data is collected in Washington. Consumer health data means personal information that is linked or reasonably linkable to a consumer and that identifies the consumer's past, present, or future physical or mental health status, under the Washington State My Health My Data Act (MHMDA). See also our other privacy notices that provide disclosures about personal information that is not consumer health data subject to MHMDA.</p>
        <p class="text-body-1 text-primary-text-color mb-4">This notice does not apply where an exception or exemption applies such as with respect to protected health information under the Health Insurance Portability and Accountability Act (“HIPAA”) and data that is subject to the Gramm-Leach-Bliley Act (“GLBA”). When we are a covered entity, we provide separate HIPAA and GLBA privacy notices to certain customers and consumers as required under applicable laws and regulations. Most consumer health data we process is regulated under HIPAA or GLBA or is processed for a necessary function.</p>

        <h2 class="text-body-1 font-weight-bold text-primary-text-color mt-8 mb-2">Consumer Health Data Collected</h2>
