          <li class="mb-2">Use or purchase of prescribed medication;</li>
          <li class="mb-2">Bodily functions, vital signs, symptoms, or measurements of other types of consumer health data;</li>
          <li class="mb-2">Diagnosis or diagnostic testing, treatment, or medication;</li>
          <li class="mb-2">Gender-affirming care information;</li>
          <li class="mb-2">Reproductive or sexual health information;</li>
          <li class="mb-2">Biometric data;</li>
          <li class="mb-2">Genetic data;</li>
          <li class="mb-2">Precise location information that could reasonably indicate a consumer's attempt to acquire or receive health services or supplies;</li>
          <li class="mb-2">Data that identifies a consumer seeking health care services; and</li>
          <li class="mb-2">Other information that may be processed to derive or infer data related to the above or other consumer health data.</li>
        </ul>
        <p class="text-body-1 text-primary-text-color mb-4">The categories of consumer health data above may include the following personal information, when collected in connection with your past, present, or future physical or mental health status:</p>
        <ul class="text-body-1 text-primary-text-color mb-4 ml-10">
          <li class="mb-2">Identifiers such as name, contact information, online identifiers, and government-issued ID numbers;</li>
          <li class="mb-2">Characteristics of Protected Classifications under state or federal law such as age and medical conditions;</li>
          <li class="mb-2">Commercial Information such as transaction information and purchase history;</li>
          <li class="mb-2">Internet or Network Activity Information such as browsing history, interactions with our website, Internet Protocol (IP) address, Media Access Control (MAC) address; operating system and version; Internet browser type and version;</li>
          <li class="mb-2">Geolocation Data such as device location; and</li>
          <li class="mb-2">Audio, Electronic, Visual and Similar Information such as call and video recordings;</li>
        </ul>
        <p class="text-body-1 text-primary-text-color mb-4">We process any de-identified consumer health data only in a de-identified fashion and will not attempt to re-identify such data.</p>

        <h2 class="text-body-1 font-weight-bold text-primary-text-color mt-8 mb-2">Why We Collect and Use Consumer Health Data</h2>
        <p class="text-body-1 text-primary-text-color mb-4">To the extent we collect your Consumer Health Data as described above, we may use it for the following purposes:</p>
