          <li class="mb-2">Business Transfers. To consider and implement mergers, acquisitions, reorganizations, and other business transactions, and where necessary to the administration of our general business, accounting, record keeping, and legal functions.</li>
          <li class="mb-2">De Identification. We may also aggregate or de-identify data by removing identifying details so it no longer identifies an individual. If we de-identify the data, we will not attempt to re-identify it.</li>
