        <h1 class="text-h4 font-weight-bold text-secondary-text-color mt-8 mb-4">HIPAA-Compliant Consent for Video and Audio Recordings in Electronic Health Records</h1>
        <p class="text-body-1 text-primary-text-color mb-4">Purpose of the Consent</p>
        <p class="text-body-1 text-primary-text-color mb-4">This consent form is designed to inform you about the use of video and audio recordings as part of your Electronic Health Records (EHR). These recordings will be used for clinical documentation, healthcare operations, and/or educational purposes, as outlined below. Your privacy and confidentiality are of utmost importance to us, and we comply with the Health Insurance Portability and Accountability Act (HIPAA) to protect your personal health information (PHI).</p>
        
        <p class="text-body-1 text-primary-text-color mb-4">Types of Recordings:</p>
        <ul class="text-body-1 text-primary-text-color mb-4 ml-10">
          <li class="mb-2">Video Recordings: Capture visual information about your medical condition and treatment.</li>
          <li class="mb-2">Audio Recordings: Capture spoken interactions between you and your healthcare provider.</li>
        </ul>

        <p class="text-body-1 text-primary-text-color mb-4">Uses of Recordings:</p>
        <ol class="text-body-1 text-primary-text-color mb-4 ml-10" type="1">
          <li class="mb-2">Clinical Documentation: Recordings may be used to document your medical condition, treatment, and interactions with healthcare providers to improve the accuracy of your EHR.</li>
          <li class="mb-2">Healthcare Operations: Recordings may be used for purposes related to the management of your care, including quality assurance, training, and compliance with legal and regulatory requirements.</li>
          <li class="mb-2">Educational Purposes: With your additional consent, recordings may be used for educational purposes, such as training healthcare professionals.</li>
        </ol>

        <h2 class="text-body-1 font-weight-bold text-primary-text-color mt-8 mb-2">Privacy and Confidentiality</h2>
        <p class="text-body-1 text-primary-text-color mb-4">Your recordings are considered PHI and will be stored securely within our EHR system. Only authorized personnel who require access to your recordings to perform their job functions will be able to view or listen to them. We implement appropriate administrative, technical, and physical safeguards to protect the confidentiality and security of your recordings.</p>

        <h2 class="text-body-1 font-weight-bold text-primary-text-color mt-8 mb-2">Right to Revoke Consent</h2>
        <p class="text-body-1 text-primary-text-color mb-4">You have the right to revoke your consent to the use of video and audio recordings at any time by notifying us in writing. However, any recordings made prior to the revocation of consent may still be used as described in this form.</p>

        <h2 class="text-body-1 font-weight-bold text-primary-text-color mt-8 mb-2">Voluntary Participation</h2>
        <p class="text-body-1 text-primary-text-color mb-4">Your participation is voluntary, and your decision to consent or not will not affect the quality of care you receive. You will not be penalized or denied healthcare services if you choose not to consent to video or audio recordings.</p>

